INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (5, 'Tony Stark, milliardaire excentrique, génie, playboy et vendeur d\'armes, est kidnappé par des terroristes. Il construit une armure pour s\'échapper.', 'Iron Man 1', '2008-04-30', 126, 'movies-img/movie-poster-1683407789.jpg', 'https://www.youtube.com/watch?v=rDCTb9Gp2qk&ab_channel=MarvelFr');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (6, 'Bruce Banner cherche un antidote aux radiations qui ont créé Hulk. Il vit dans l\'ombre, toujours amoureux, et parcourt le monde recherchant un remède.', 'L\'Incroyable Hulk', '2008-07-23', 112, 'movies-img/movie-poster-1683408728.jpg', 'https://www.youtube.com/watch?v=LCjTxK1B5Pg&ab_channel=Gagtiger');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (7, 'Le monde sait désormais que le génie milliardaire Tony Stark est Iron Man. Malgré la pression de tous, Tony n\'est pas disposé à divulguer ses secrets.', 'Iron Man 2', '2010-04-28', 124, 'movies-img/movie-poster-1683408898.jpg', 'https://www.youtube.com/watch?v=0Y7ullsUPEA&ab_channel=SuperBeri');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (8, 'La légende dit qu\'autrefois, Aaron, l\'Aura Gardien, aidé de son Pokémon Lucario, réussit à arrêter une terrible guerre. Au Palais Cameran, les habitants organisent chaque année un tournoi Pokémon pour le célébrer. Sacha y participe et gagne, obtenant ainsi le titre d\'Aura Gardien. Mais le Pokémon légendaire Mew apparait alors et kidnappe Pikachu ! Lucario fait irruption et emmène Sacha et ses amis dans un périple à destination du mystérieux Arbre des Origines qui est protégé par les Golems Regirock, Regice et Registeel.', 'Pokemon - Lucario', '2008-03-12', 99, 'movies-img/movie-poster-1683409004.jpg', 'https://www.youtube.com/watch?v=e9y1oPeTP_0');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (9, 'Giratina est le seul Pokémon habitant dans le Monde Inversé. En colère suite à la fissure spatio-temporelle provoquée par Palkia et Dialga, il attire Dialga dans ce royaume pour l\'affronter, mais le combat est arrêté par un petit Shaymin, le Pokémon Gratitude. Épuisé, Shaymin quitte le Monde Inversé et demande à Sacha et ses amis de l\'aider dans son voyage. Nos héros acceptent et pénètrent dans le Monde Inversé, où ils rencontrent Newton Graceland. Zéro, son ancien assistant, cherche à s\'emparer du pouvoir de Giratina pour contrôler le Monde Inversé, même si cela entraîne la destruction du monde réel! Nos héros pourront-ils contrecarrer ses plans maléfiques et protéger les deux mondes? Giratina pourra-t-il résoudre son différend avec Dialga? Et qu\'apprendront Sacha et ses amis sur ce Shaymin?', 'Pokemon - Giratina', '2011-03-12', 103, 'movies-img/movie-poster-1683409134.jpg', 'https://www.youtube.com/watch?v=G_FEKAE5OLk');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (12, 'Thor, Dieu tout puissant mais arrogant, est exilé du royaume d\'Asgard et envoyé sur Terre. Mais quand les forces du mal arrivent, il devient un héros.', 'Thor (2011)', '2011-05-27', 115, 'movies-img/movie-poster-1683409371.jpg', 'https://www.youtube.com/watch?v=pzT3yeV9lT4&ab_channel=SlashersHouse');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (13, 'Sacha pense tout connaître sur les Pokémon, mais est-il prêt à affronter le mystérieux Darkrai dans cette fabuleuse aventure? Sacha et ses amis, accompagnés d\'Alice, traversent la ville d\'Alamos où se trouvent les Tours de l\'Espace-Temps. Nos héros apprennent que ses habitants sont victimes de terribles cauchemars. Selon l\'arrogant Baron Alberto, ils sont dus à Darkrai, le Pokémon fabuleux... qui apparaît bientôt et confronte nos héros. Qui est vraiment Darkrai? Alors que les cieux se déchirent au-dessus d\'Alamos et qu\'apparaissent les Pokémon légendaires Dialga et Palkia, leur affrontement menace de déchirer le continuum espace-temps ! Sacha et ses amis vont-ils résister à cette lutte et découvrir la vraie nature de Darkrai?', 'Pokemon - Darkrai', '2008-12-23', 90, 'movies-img/movie-poster-1683409417.jpg', 'https://www.youtube.com/watch?v=8rogFtORh0A');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (14, 'De la découverte d\'un fossile de Mew, le Pokémon fabuleux, les chercheurs font naître une création contraire aux lois de la nature : Mewtwo, un Pokémon légendaire créé pour devenir un instrument de destruction. Lorsque Mewtwo prend conscience de son existence, il développe une haine à l\'encontre de ses créateurs, les humains, et cherche vengeance. Sacha, Pikachu et leurs amis sont pris dans cette tourmente. Le futur du monde Pokémon est en jeu. Nos héros réussiront-ils à relever le défi de Mewtwo... Et Mewtwo trouvera-t-il un nouveau sens à sa vie ?', 'Pokemon - Mewtwo', '2001-03-12', 98, 'movies-img/movie-poster-1683409463.jpg', 'https://www.youtube.com/watch?v=g5SEp2lzMIk');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (15, 'Steve est transformé en super-soldat grâce à une expérience top-secrète. Il devient alors Captain America pour défendre les idéaux des Etats-Unis.', 'Captain America - First Avenger', '2011-08-17', 124, 'movies-img/movie-poster-1683409488.jpg', 'https://www.youtube.com/watch?v=B9Org1_P8FM&ab_channel=Steven.P');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (16, 'Notre histoire se passe longtemps avant que l\'Éclair et l\'Épéiste noir ne soient connus sous ces noms-là... Le jour où elle enfile le Nerve Gear, Yûki Asuna n\'est qu\'une élève de troisième, au collège, qui n\'a jamais touché à un jeu en ligne de sa vie.', 'SAO - Starless Night', '2017-03-12', 141, 'movies-img/movie-poster-1683409540.jpg', 'https://www.youtube.com/watch?v=9Vhujz0OFnw');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (17, 'Thor se bat pour restaurer l’ordre dans le cosmos, mais une ancienne race, sous la conduite du terrible Malekith, un être assoiffé de vengeance, revient pour répandre les ténèbres. Confronté à un ennemi que même Odin et Asgard ne peuvent contrer, Thor doit s’engager dans son aventure la plus dangereuse et la plus personnelle, au cours de laquelle il va devoir s’allier au traître Loki pour sauver non seulement son peuple et ceux qui lui sont chers, mais aussi l’univers lui-même.', 'Thor - Le monde des ténèbres', '2013-10-30', 112, 'movies-img/movie-poster-1683409547.jpg', 'https://www.youtube.com/watch?v=uq4OFEwflnI&ab_channel=MarvelFR');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (18, 'En l\'an 2026, deux ans après avoir été libérés de S.A.O, Kazuto et ses amis survivants profitent enfin de jours paisibles. Récemment, la réalité augmentée est devenue possible grâce à l\'Augma, et avec cette mode vient son lot de modifications du quotidien.', 'SAO - Ordinal Scale', '2016-03-12', 167, 'movies-img/movie-poster-1683409583.jpg', 'https://www.youtube.com/watch?v=hYIxyT-PMVQ');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (19, 'Kirito se réveille dans un gigantesque monde virtuel fantastique. Sa mémoire lui faisant défaut, il se lance à la recherche d’indices. C’est au pied d’un arbre noir qu’il fait la rencontre du jeune Eugeo. Bien qu’étant un NPC, un personnage de ce monde virtuel, ce dernier est capable de ressentir et d’exprimer des sentiments humains. Alors que Kirito continue à chercher un moyen de se déconnecter, il se souvient avoir déjà couru avec Eugeo sur la montagne où ils se trouvent. Mais comment est-ce possible, ce souvenir ne devrait normalement pas exister ? Qui plus est, une jeune fille aux cheveux blonds est présente dans ce souvenir : Alice. Un nom qu\'il ne faut à aucun prix oublier...', 'SAO - Alicization', '2016-03-12', 169, 'movies-img/movie-poster-1683409624.jpg', 'https://www.youtube.com/watch?v=xBlQujV_4Pg');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (20, 'Peter rassemble une équipe d\'aliens pour défendre la galaxie, menacée par Ronan et son armée, qui cherchent un mystérieux globe volé.', 'Les Gardiens de la Galaxie 1', '2014-08-13', 122, 'movies-img/movie-poster-1683409641.jpg', 'https://www.youtube.com/watch?v=ry19UYQoAro&ab_channel=FilmsActu');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (21, '« Vous êtes peut-être dans un jeu, mais vous n\'êtes pas là pour jouer. » Un mois a passé depuis que Sword Art Online, le tout premier MMORPG en réalité virtuelle, a été coupé du monde. Pour dix mille joueurs, toute mort en jeu entraîne inévitablement un décès dans le monde réel.', 'SAO - Scherzo', '2022-03-12', 123, 'movies-img/movie-poster-1683409688.jpg', 'https://www.youtube.com/watch?v=85lkBETYlIM');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (22, 'Jeune lycéen, Hodaka fuit son île pour rejoindre Tokyo. Sans argent ni emploi, il tente de survivre dans la jungle urbaine et trouve un poste dans une revue dédiée au paranormal. Un phénomène météorologique extrême touche alors le Japon, exposé à de constantes pluies. Hodaka est dépêché pour enquêter sur l\'existence de prêtresses du temps. Peu convaincu par cette légende, il change soudainement d\'avis lorsqu\'il croise la jeune Hina...', 'Les enfants du temps', '2021-05-07', 162, 'movies-img/movie-poster-1683409760.jpg', 'https://www.youtube.com/watch?v=E8qYl2_b6HI');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (23, 'Nishimiya est une élève douce et attentionnée. Chaque jour, pourtant, elle est harcelée par Ishida, car elle est sourde. Dénoncé pour son comportement, le garçon est à son tour mis à l\'écart et rejeté par ses camarades. Des années plus tard, il apprend la langue des signes... et part à la recherche de la jeune fille.', 'Silent Voice', '2017-03-12', 121, 'movies-img/movie-poster-1683409798.jpg', 'https://www.youtube.com/watch?v=0MelIAXhyLc');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (24, 'Steve Rogers est désormais à la tête des Avengers, dont la mission est de protéger l\'humanité. À la suite d\'une de leurs interventions qui a causé d\'importants dégâts collatéraux, le gouvernement décide de mettre en place un organisme de commandement et de supervision.', 'Captain America : Civil War', '2016-04-27', 147, 'movies-img/movie-poster-1683409843.jpg', 'https://www.youtube.com/watch?v=fuIIGDjEj8Q&ab_channel=MarvelFR');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (25, 'Shibuya, le monde des humains, et Jutengai, le monde des Bêtes... C\'est l\'histoire d\'un garçon solitaire et d\'une Bête seule, qui vivent chacun dans deux mondes séparés. Un jour, le garçon se perd dans le monde des Bêtes où il devient le disciple de la Bête Kumatetsu qui lui donne le nom de Kyuta.', 'Le Garçon et la Bête', '2016-03-21', 134, 'movies-img/movie-poster-1683409855.jpg', 'https://www.youtube.com/watch?v=TNXc9_cAkyg');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (26, 'Stephen Strange, un neurochirurgien, se blesse gravement aux mains lors d\'un accident. Dans sa quête de les soigner, il entreprend un voyage qui va le mener vers l\'apprentissage de la magie.', 'Doctor Strange (2016)', '2016-10-26', 115, 'movies-img/movie-poster-1683409911.jpg', 'https://www.youtube.com/watch?v=bly7XM7QzSY&ab_channel=FilmsActu');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (27, 'Quatre lycéens découvrent une vieille console contenant un jeu vidéo dont ils n’avaient jamais entendu parler : Jumanji. En voulant jouer, ils se retrouvent mystérieusement propulsés dans la jungle de Jumanji, où ils deviennent leurs avatars', 'Jumanji', '2015-03-12', 123, 'movies-img/movie-poster-1683409931.jpg', 'https://www.youtube.com/watch?v=oZI2njF5rx0');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (28, 'Thor est retenu prisonnier à l\'autre bout de l\'univers sans son puissant marteau, et se retrouve face à une course contre la montre pour retourner à Asgard et arrêter le Ragnarok, qui signifie la destruction de son monde et la fin de la civilisation asgardienne des mains de la toute puissante et impitoyable Hela. Mais avant cela, il doit survivre à une lutte mortelle entre gladiateurs, qui le voit faire face à son ancien allié et ami, l\'Incroyable Hulk !', 'Thor: Ragnarok', '2017-10-25', 130, 'movies-img/movie-poster-1683409967.jpg', 'https://www.youtube.com/watch?v=RtG6scyBIeM&ab_channel=MarvelFR');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (29, 'L\'équipe est de retour mais le jeu a changé. Alors qu\'ils retournent dans Jumanji pour secourir l\'un des leurs, ils découvrent un monde totalement inattendu. Des déserts arides aux montagnes enneigées, les joueurs vont devoir braver des espaces inconnus et inexplorés, afin de sortir du jeu le plus dangereux du monde.', 'Jumanji - Next Level', '2019-03-12', 163, 'movies-img/movie-poster-1683409983.jpg', 'https://www.youtube.com/watch?v=RhWRa0wBBHA');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (30, 'T\'Challa retourne au royaume de Wakanda, une nation africaine cachée et convoitée, afin de prendre sa place légitime sur le trône.', 'Black Panther', '2018-02-14', 134, 'movies-img/movie-poster-1683410025.jpg', 'https://www.youtube.com/watch?v=xjDjIWPwcPU&ab_channel=MarvelEntertainment');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (31, 'Un virus inconnu se répand en Corée du Sud, l\'état d\'urgence est décrété. Les passagers du train KTX se livrent à une lutte sans merci afin de survivre jusqu\'à Busan, l\'unique ville où ils seront en sécurité...', 'Le dernier train pour busan', '2013-12-13', 152, 'movies-img/movie-poster-1683410047.jpg', 'https://www.youtube.com/watch?v=V9Zg3F5EEjQ');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (32, 'Après les événements survenus dans Captain America : Civil War, Scott Lang a bien du mal à concilier sa vie de super-héros et ses responsabilités de père. Mais ses réflexions sur les conséquences de ses choix tournent court lorsque Hope van Dyne et le Dr Hank Pym lui confient une nouvelle mission urgente… Scott va devoir renfiler son costume et apprendre à se battre aux côtés de La Guêpe afin de faire la lumière sur des secrets enfouis de longue date…', 'Ant-Man et la Guêpe', '2018-07-18', 118, 'movies-img/movie-poster-1683410074.jpg', 'https://www.youtube.com/watch?v=A5jzpMR6rv4&ab_channel=MarvelFR');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (33, 'Quatre ans après Dernier train pour Busan, il ne reste que des zombies dans la péninsule. Un groupe de soldats forcés d’y retourner découvrent que des survivants non contaminés se sont regroupés dans une bande bien plus dangereuse que les zombies...', 'Peninsula', '2019-03-12', 151, 'movies-img/movie-poster-1683410092.jpg', 'https://www.youtube.com/watch?v=2pn0od5XA9w');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (34, 'Captain Marvel raconte l’histoire de Carol Danvers qui va devenir l’une des super-héroïnes les plus puissantes de l’univers lorsque la Terre se révèle l’enjeu d’une guerre galactique entre deux races extraterrestres.', 'Captain Marvel', '2019-03-06', 124, 'movies-img/movie-poster-1683410125.jpg', 'https://www.youtube.com/watch?v=rndLWLmwgeA&ab_channel=MarvelFR');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (35, 'Le groupe de Tanjirô a terminé son entraînement de récupération au domaine des papillons et embarque à présent en vue de sa prochaine mission à bord du train de l\'infini, d\'où quarante personnes ont disparu en peu de temps.', 'Demon Slayer - Le train de l\'infini', '2021-03-12', 152, 'movies-img/movie-poster-1683410148.jpg', 'https://www.youtube.com/watch?v=Eam4YDTTkdI');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (36, 'Le jeune Peter Parker découvre peu à peu sa nouvelle identité, celle de Spider-Man, le super-héros lanceur de toile. Galvanisé par son expérience avec les Avengers, Peter rentre chez lui auprès de sa tante May, sous l’œil attentif de son nouveau mentor, Tony Stark.', 'Spiderman - Homecoming', '2016-03-21', 142, 'movies-img/movie-poster-1683410203.jpg', 'https://www.youtube.com/watch?v=mJQ4u-kXoGc');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (38, 'L\'araignée sympa du quartier décide de rejoindre ses meilleurs amis Ned, MJ, et le reste de la bande pour des vacances en Europe. Cependant, le projet de Peter de laisser son costume de super-héros derrière lui pendant quelques semaines est rapidement compromis quand il accepte à contrecoeur d\'aider Nick Fury à découvrir le mystère de plusieurs attaques de créatures, qui ravagent le continent !', 'Spiderman - Far From Home', '2019-03-12', 152, 'movies-img/movie-poster-1683410262.jpg', 'https://www.youtube.com/watch?v=FguIk-SEkWI');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (39, 'Pour la première fois dans son histoire cinématographique, Spider-Man, le héros sympa du quartier est démasqué et ne peut désormais plus séparer sa vie normale de ses lourdes responsabilités de super-héros. Quand il demande de l\'aide à Doctor Strange, les enjeux deviennent encore plus dangereux...', 'Spideman - No Way Home', '2022-02-24', 152, 'movies-img/movie-poster-1683410317.jpg', 'https://www.youtube.com/watch?v=7w_w10HVa54');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (40, 'Shang-Chi va devoir affronter un passé qu’il pensait avoir laissé derrière lui lorsqu’il est pris dans la toile de la mystérieuse organisation des Dix Anneaux.', 'Shang-Chi et la Légende des Dix Anneaux', '2021-09-01', 132, 'movies-img/movie-poster-1683410328.jpg', 'https://www.youtube.com/watch?v=PD3rUCBFDlI&ab_channel=MarvelFR');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (41, 'Depuis l\'aube de l\'humanité, les Éternels, un groupe de héros venus des confins de l\'univers, protègent la Terre. Lorsque les Déviants, des créatures monstrueuses que l\'on croyait disparues depuis longtemps, réapparaissent mystérieusement, les Éternels sont à nouveau obligés de se réunir pour défendre l\'humanité…', 'Les Éternels', '2021-11-03', 157, 'movies-img/movie-poster-1683410372.jpg', 'https://www.youtube.com/watch?v=nHcubNwuKFA&ab_channel=MarvelFR');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (42, 'Après avoir retrouvé Gwen Stacy, Spider-Man, le sympathique héros originaire de Brooklyn, est catapulté à travers le Multivers, où il rencontre une équipe de Spider-Héros chargée d\'en protéger l\'existence. Mais lorsque les héros s\'opposent sur la façon de gérer une nouvelle menace, Miles se retrouve confronté à eux et doit redéfinir ce que signifie être un héros afin de sauver les personnes qu\'il aime le plus.', 'Spiderman - Next Gen', '2017-12-13', 111, 'movies-img/movie-poster-1683410383.jpg', 'https://www.youtube.com/watch?v=UQDvqI7I7q4');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (44, 'Mitsuha, adolescente coincée dans une famille traditionnelle, rêve de quitter ses montagnes natales pour découvrir la vie trépidante de Tokyo. Elle est loin d’imaginer pouvoir vivre l’aventure urbaine dans la peau de… Taki, un jeune lycéen vivant à Tokyo, occupé entre son petit boulot dans un restaurant italien et ses nombreux amis.', 'Your Name', '2017-03-21', 123, 'movies-img/movie-poster-1683410449.jpg', 'https://www.youtube.com/watch?v=AROOK45LXXg');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (45, 'Voyagez dans l’inconnu avec Doctor Strange, qui avec l’aide d’anciens et de nouveaux alliés mystiques, traverse les réalités hallucinantes et dangereuses du multivers pour affronter un nouvel adversaire mystérieux.', 'Doctor Strange - Multiverse of Madness', '2022-05-04', 126, 'movies-img/movie-poster-1683410475.jpg', 'https://www.youtube.com/watch?v=aWzlQ2N6qqg&ab_channel=MarvelEntertainment');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (46, 'Alors qu’ils tentent de réparer une canalisation souterraine, Mario et son frère Luigi, tous deux plombiers, se retrouvent plongés dans un nouvel univers féerique à travers un mystérieux conduit.', 'Super Mario Bros', '2023-03-12', 123, 'movies-img/movie-poster-1683410494.png', 'https://www.youtube.com/watch?v=beVRhM8jEwc');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (47, 'Notre bande de marginaux favorite a quelque peu changé. Peter Quill, qui pleure toujours la perte de Gamora, doit rassembler son équipe pour défendre l’univers et protéger l’un des siens. En cas d’échec, cette mission pourrait bien marquer la fin des Gardiens tels que nous les connaissons.', 'Les Gardiens de la galaxie Vol. 3', '2023-05-03', 150, 'movies-img/movie-poster-1683410519.jpg', 'https://www.youtube.com/watch?v=0RsvBSFm938&ab_channel=FilmsActu');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (48, 'Nathan Drake, voleur astucieux et intrépide, est recruté par le chasseur de trésors chevronné Victor « Sully » Sullivan pour retrouver la fortune de Ferdinand Magellan, disparue il y a 500 ans.', 'Uncharted', '2019-03-21', 141, 'movies-img/movie-poster-1683410533.jpg', 'https://www.youtube.com/watch?v=mduvAjUGl4s');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (49, 'Après la mort du roi T\'Challa alias Black Panther, le Wakanda est en deuil et Ramonda a repris le siège royal avec l\'aide de sa fille Shuri, des Dora Milaje, Okoye, Ayo et de M\'Baku. Cependant, quand Namor, roi de Talocan, déclare la guerre à la nation, les personnages que nous connaissons vont devoir s\'allier à de nouvelles personnes, comme Riri Williams mais aussi à d\'anciennes connaissances pour vaincre cette menace.', 'Black Panther: Wakanda Forever', '2022-11-09', 161, 'movies-img/movie-poster-1683410577.jpg', 'https://www.youtube.com/watch?v=DlGIWM_e9vg&ab_channel=MarvelFR');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (50, 'Bien installé dans la petite ville de Green Hills, Sonic veut maintenant prouver qu’il a l’étoffe d\' un véritable héros. Un défi de taille se présente à lui quand le Dr Robotnik refait son apparition.', 'Sonic 2', '2021-03-12', 142, 'movies-img/movie-poster-1683410591.jpg', 'https://www.youtube.com/watch?v=SqH3-sCkZQw');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (51, 'Bien installé dans la petite ville de Green Hills, Sonic veut maintenant prouver qu’il a l’étoffe d\' un véritable héros. Un défi de taille se présente à lui quand le Dr Robotnik refait son apparition.', 'Sonic', '2021-04-21', 123, 'movies-img/movie-poster-1683410639.jpg', 'https://www.youtube.com/watch?v=SqH3-sCkZQw');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (52, 'Après avoir été l’un des meilleurs pilotes de chasse de la Marine américaine, Pete “Maverick" Mitchell continue à repousser ses limites en tant que pilote d\'essai. Il est chargé de former un détachement de jeunes diplômés de l’école Top Gun pour une mission spéciale qu’aucun pilote n\'aurait jamais imaginée.', 'Top Gun - Maverick', '2022-04-12', 124, 'movies-img/movie-poster-1683410694.jpg', 'https://www.youtube.com/watch?v=JYaFU81-t6c');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (53, 'Se déroulant plus d’une décennie après les événements relatés dans le premier film, AVATAR : LA VOIE DE L’EAU raconte l\'histoire des membres de la famille Sully (Jake, Neytiri et leurs enfants), les épreuves auxquelles ils sont confrontés, les chemins qu’ils doivent emprunter pour se protéger les uns les autres, les batailles qu’ils doivent mener pour rester en vie et les tragédies qu\'ils endurent.', 'Avatar - La voie de l\'eau', '2022-04-12', 124, 'movies-img/movie-poster-1683410742.jpg', 'https://www.youtube.com/watch?v=598NnroP42s');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (54, 'Sur la lointaine planète de Pandora, Jake Sully, un héros malgré lui, se lance dans une quête de rédemption, de découverte, d\'amour inattendu, dont l\'issue sera un combat héroïque pour sauver toute une civilisation.', 'Avatar', '2008-04-12', 142, 'movies-img/movie-poster-1683410809.jpg', 'https://www.youtube.com/watch?v=60ArLSCgjSU&t=7s');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (55, 'À Derry, dans le Maine, sept gamins ayant du mal à s\'intégrer se sont regroupés au sein du "Club des Ratés". Rejetés par leurs camarades, ils sont les cibles favorites des gros durs de l\'école. Ils ont aussi en commun d\'avoir éprouvé leur plus grande terreur face à un terrible prédateur métamorphe qu\'ils appellent "Ça"…', 'CA - Chapitre 1', '2016-03-12', 162, 'movies-img/movie-poster-1683410857.jpg', 'https://www.youtube.com/watch?v=FnCdOQsX5kc');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (56, '27 ans après la victoire du Club des Ratés sur Grippe-Sou, le sinistre Clown est de retour pour semer la terreur dans les rues de Derry. Désormais adultes, les membres du Club ont tous quitté la petite ville pour faire leur vie. Cependant, lorsqu\'on signale de nouvelles disparitions d\'enfants, Mike, le seul du groupe à être demeuré sur place, demande aux autres de le rejoindre.', 'CA - Chapitre 2', '2016-03-12', 162, 'movies-img/movie-poster-1683410911.jpg', 'https://www.youtube.com/watch?v=yOZA2y_dQA4');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (57, 'Lorsque des légions de monstreuses créatures extraterrestres surgirent des océans, une terrible guerre débuta. Pour les combattre, les hommes créèrent des robots géants, les Jaegers. Mais meme ces terribles Jaegers ne pouvaient vaincre ces créatures. Alors que la défaite est proche, l\'humanité doit désormais se reposer sur deux héros improbables, qui décident de faire revivre un vieux Jaegers. C\'est l\'ultime espoir face à l\'apocalypse...', 'Pacific Rim', '2013-02-12', 141, 'movies-img/movie-poster-1683410980.jpg', 'https://www.youtube.com/watch?v=qOX_O118N7k&t=1s');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (58, 'Le conflit planétaire qui oppose les Kaiju, créatures extraterrestres, aux Jaegers, robots géants pilotés par des humains, n’était que la première vague d’une attaque massive contre l’Humanité...', 'Pacific Rim - Uprising', '2021-04-12', 151, 'movies-img/movie-poster-1683411084.jpg', 'https://www.youtube.com/watch?v=m6YGQJazEbg');
INSERT INTO Flutters.MOVIE (id_movie, description, title, release_date, duration, poster_image, trailer) VALUES (59, 'Tony Stark, l’industriel flamboyant qui est aussi Iron Man, est confronté cette fois à un ennemi qui va attaquer sur tous les fronts. Lorsque son univers personnel est détruit, Stark se lance dans une quête acharnée pour retrouver les coupables. Plus que jamais, son courage va être mis à l’épreuve, à chaque instant. Dos au mur, il ne peut plus compter que sur ses inventions, son ingéniosité, et son instinct pour protéger ses proches. Alors qu’il se jette dans la bataille, Stark va enfin découvrir la réponse à la question qui le hante secrètement depuis si longtemps : est-ce l’homme qui fait le costume ou bien le costume qui fait l’homme ?', 'Iron Man 3', '2014-04-12', 142, 'movies-img/movie-poster-1683411155.jpg', 'https://www.youtube.com/watch?v=wnEr73Rq3Ac');
