INSERT INTO Flutters.REVIEW (id_review, description, score, id_movie, id_client, publication_date) VALUES (8, 'Black Panther est un film de super-héros visuellement impressionnant avec une distribution incroyablement talentueuse. Cependant, le scénario peut sembler un peu prévisible et manquer de profondeur pour certains spectateurs.', 3, 30, 4, '2023-05-07');
INSERT INTO Flutters.REVIEW (id_review, description, score, id_movie, id_client, publication_date) VALUES (9, 'CA Chapitre 2 offre une expérience cinématographique divertissante avec des effets visuels impressionnants et des performances convaincantes de la distribution. Cependant, le film peut sembler un peu long et certaines scènes pourraient être considérées comme trop violentes ou dérangeantes pour certains spectateurs.', 4, 56, 4, '2023-05-07');
INSERT INTO Flutters.REVIEW (id_review, description, score, id_movie, id_client, publication_date) VALUES (10, 'Film d\'animation trop cool pour les fans de Sword Art Online ! Les combats sont super intenses, les personnages sont badass et l\'histoire est super captivante. Si t\'as envie d\'un film d\'animation bourré d\'action et de suspens, SAO Ordinal Scale c\'est le kiff total !', 5, 18, 4, '2023-05-07');
INSERT INTO Flutters.REVIEW (id_review, description, score, id_movie, id_client, publication_date) VALUES (12, 'Le film Uncharted manque de profondeur et d\'originalité, et les performances des acteurs laissent à désirer. Bien qu\'il y ait des moments d\'action et de divertissement, l\'intrigue prévisible et les personnages peu développés ne parviennent pas à maintenir l\'intérêt du spectateur tout au long du film.', 1, 48, 4, '2023-05-07');
INSERT INTO Flutters.REVIEW (id_review, description, score, id_movie, id_client, publication_date) VALUES (13, 'Le film est une véritable réussite dans tous les aspects, avec une histoire bien construite, des personnages développés et des scènes d\'action époustouflantes. La direction est excellente et la cinématographie est à couper le souffle, faisant de cette œuvre un must-see pour tous les fans de cinéma.', 5, 54, 4, '2023-05-07');
