INSERT INTO Flutters.REVIEW (id_review, description, score, id_movie, id_client, publication_date) VALUES (37, 'Je me dois de témoigner ma plus profonde admiration pour ce chef-d\'oeuvre cinématographique, car il possède un degré d\'élégance et de grandeur inégalé dans sa narration et son esthétique. Les acteurs sont tout simplement extraordinaires, offrant des performances ensorcelantes qui ont envoûté mes sens et ému mon âme.', 5, 53, 6, '2023-05-07');
